;eval("define(\"oea/components/edx-multiple-choice\", \n  [\"ember\",\"oea/utils/edx\",\"oea/components/edx-base\",\"exports\"],\n  function(__dependency1__, __dependency2__, __dependency3__, __exports__) {\n    \"use strict\";\n    var Ember = __dependency1__[\"default\"];\n    var EdX = __dependency2__[\"default\"];\n    var EdXBase = __dependency3__[\"default\"];\n\n    __exports__[\"default\"] = EdXBase.extend({\n\n      choicePrefix: \'choice_\',\n\n      didInsertElement: function(){\n        this.set(\'graded\', {});\n        this._super();\n      },\n\n      click: function(e){\n        var radio = $(e.target);\n        if(!radio.is(\'[type=\"radio\"]\')){\n          radio = radio.find(\'[type=\"radio\"]\');\n        }\n        if(radio.length > 0){\n          var args = {\n            id: radio.attr(\'id\').replace(this.choicePrefix, \'\')\n          };\n          Ember.run.debounce(this, this.checkAnswers, args, 300);\n        }\n      },\n\n      title: function(){\n        return this.get(\'content.xml\').attr(\'display_name\');\n      }.property(\'content.xml\'),\n\n      question: function(){\n        var choices = this.get(\'choices\') || {};\n        var contents = Ember.$(\'<div>\').append(this.get(\'content.xml\').html());\n        contents.find(\'solution\').remove();\n\n        contents.find(\'multiplechoiceresponse\').each(function(i, response){\n          var html = \'\';\n          response = Ember.$(response);\n          response.find(\'choicegroup\').each(function(j, group){\n            group = Ember.$(group);\n            var groupName = \"\";\n            group.find(\'choice\').each(function(k, choice){\n              var groupName = \'group_\' + i + \'_\' + j;\n              choice = Ember.$(choice);\n              var id = i + \'_\' + j + \'_\' + k;\n              choices[id] = {\n                correct: choice.attr(\'correct\')\n              }\n              html += \'<div class=\"btn btn-block btn-question\"><label class=\"radio\"><input id=\"\' + this.choicePrefix + id + \'\" type=\"radio\" name=\"\' + groupName + \'\" value=\"\' + choice.attr(\'name\') + \'\">\' + choice.html() + \'</label></div>\';\n            }.bind(this));\n          }.bind(this));\n          html = \'<div class=\"multiple-choice-question\">\' + html + \'</div>\';\n          response.replaceWith(html);\n        }.bind(this));\n        this.set(\'choices\', choices);\n        return contents.html();\n      }.property(\'content.xml\'),\n\n      solution: function(){\n        return this.get(\'content.xml\').find(\'solution\').html();\n      }.property(\'content.xml\'),\n\n      checkAnswers: function(args){\n        var graded = this.get(\'graded\') || {};\n        var choice = this.get(\'choices\')[args.id];\n        if(choice && choice.correct == \'true\'){\n          graded[args.id] = {\n            correct: true,\n            feedback: \'\',\n            score: 1\n          };\n        } else {\n          graded[args.id] = {\n            correct: false,\n            feedback: \'\',\n            score: 0\n          };\n        }\n\n        this.get(\'content\').set(\'graded\', graded);\n      },\n\n      isGradedDidChange: function(){\n        this.$(\'.incorrect\').removeClass(\'incorrect\');\n        var graded = this.get(\'content.graded\');\n        Ember.$.each(graded, function(i, graded){\n          if(!graded.correct){\n            this.$(\'#\' + this.choicePrefix + i).parents(\'.btn-question\').addClass(\'incorrect\');\n          }\n        }.bind(this));\n\n      }.observes(\'content.isGraded\')\n\n    });\n\n    // Example xml for Multiple Choice\n\n    // <problem display_name=\"Multiple Choice\" markdown=\"A multiple choice problem presents radio buttons for student input. Students can only select a single option presented. Multiple Choice questions have been the subject of many areas of research due to the early invention and adoption of bubble sheets.&#10;&#10;One of the main elements that goes into a good multiple choice question is the existence of good distractors. That is, each of the alternate responses presented to the student should be the result of a plausible mistake that a student might make.&#10;&#10;&gt;&gt;What Apple device competed with the portable CD player?&lt;&lt;&#10;     ( ) The iPad&#10;     ( ) Napster&#10;     (x) The iPod&#10;     ( ) The vegetable peeler&#10;     &#10;[explanation]&#10;The release of the iPod allowed consumers to carry their entire music library with them in a format that did not rely on fragile and energy-intensive spinning disks.&#10;[explanation]&#10;\">\n    //   <p>\n    // A multiple choice problem presents radio buttons for student\n    // input. Students can only select a single option presented. Multiple Choice questions have been the subject of many areas of research due to the early invention and adoption of bubble sheets.</p>\n    //   <p> One of the main elements that goes into a good multiple choice question is the existence of good distractors. That is, each of the alternate responses presented to the student should be the result of a plausible mistake that a student might make. \n    // </p>\n    //   <p>What Apple device competed with the portable CD player?</p>\n    //   <multiplechoiceresponse>\n    //     <choicegroup type=\"MultipleChoice\" label=\"What Apple device competed with the portable CD player?\">\n    //       <choice correct=\"false\" name=\"ipad\">The iPad</choice>\n    //       <choice correct=\"false\" name=\"beatles\">Napster</choice>\n    //       <choice correct=\"true\" name=\"ipod\">The iPod</choice>\n    //       <choice correct=\"false\" name=\"peeler\">The vegetable peeler</choice>\n    //     </choicegroup>\n    //   </multiplechoiceresponse>\n    //   <solution>\n    //     <div class=\"detailed-solution\">\n    //       <p>Explanation</p>\n    //       <p>The release of the iPod allowed consumers to carry their entire music library with them in a format that did not rely on fragile and energy-intensive spinning disks. </p>\n    //     </div>\n    //   </solution>\n    // </problem>\n  });//# sourceURL=oea/components/edx-multiple-choice.js");

;eval("define(\"oea/components/edx-numeric-input\", \n  [\"ember\",\"oea/utils/edx\",\"oea/components/edx-base\",\"exports\"],\n  function(__dependency1__, __dependency2__, __dependency3__, __exports__) {\n    \"use strict\";\n    var Ember = __dependency1__[\"default\"];\n    var EdX = __dependency2__[\"default\"];\n    var EdXBase = __dependency3__[\"default\"];\n\n\n    __exports__[\"default\"] = EdXBase.extend({\n\n      inputPrefix: \'numeric_question_\',\n\n      didInsertElement: function(){\n        // Set initial graded value for all numericalresponses in the question xml. \n        // This ensures that unanswered questions are marked incorrect.\n        var graded = {};\n        this.get(\'content.xml\').find(\'numericalresponse\').each(function(i, numericalresponse){\n          graded[i] = {\n            correct: false,\n            feedback: \"\",\n            score: 0\n          };\n        });\n        this.set(\'graded\', graded);\n        this._super();\n      },\n\n      computedResponses: function(){\n        var computed = {};\n        this.get(\'content.xml\').find(\'[type=\"loncapa/python\"]\').each(function(i, script){\n          var parts = $(script).html().trim().split(\'=\');\n          computed[\'$\' + parts[0].trim()] = math.eval(parts[1].trim());\n        });\n        return computed;\n      }.property(\'content.xml\'),\n\n      keyUp: function(e){\n        var args = {\n          id: e.target.id.replace(this.inputPrefix, \'\'),\n          value: e.target.value\n        };\n        Ember.run.debounce(this, this.checkAnswers, args, 300);\n      },\n\n      title: function(){\n        return this.get(\'content.xml\').attr(\'display_name\');\n      }.property(\'content.xml\'),\n\n      question: function(){\n        var inputs = Ember.Map.create();\n        var contents = Ember.$(\'<div>\').append(this.get(\'content.xml\').html());\n        contents.find(\'solution\').remove();\n\n        contents.find(\'numericalresponse\').each(function(i, numericalresponse){\n          numericalresponse = Ember.$(numericalresponse);\n          inputs.set(i, numericalresponse);\n          var input = Ember.$(\'<input/>\').attr(\'id\', this.inputPrefix + i).attr(\'type\', \'text\');\n          numericalresponse.replaceWith(input);\n        }.bind(this));\n\n        this.set(\'inputs\', inputs);\n\n        return contents.html();\n\n      }.property(\'content.xml\'),\n\n      solution: function(){\n        return this.get(\'content.xml\').find(\'solution\').html();\n      }.property(\'content.xml\'),\n\n      checkAnswers: function(args){\n        var correct = false;\n        var score = 0;\n        var graded = this.get(\'graded\');\n        var numericalResponse = this.get(\'inputs\').get(parseInt(args.id, 10));\n        var studentResponse;\n        var answer;\n        var answerVal = numericalResponse.attr(\'answer\');\n\n        if(answerVal[0] == \'$\' && this.get(\'computedResponses\')[answerVal]){\n          answer = this.get(\'computedResponses\')[answerVal];\n        } else {\n          answer = parseFloat(answerVal, 10);\n        }\n\n        try{\n          studentResponse = math.eval(args.value);\n        }\n        catch(err){\n          graded[args.id] = {\n            correct: false,\n            feedback: \"Unable to parse expression. Please check that it\'s valid\",\n            score: score\n          };\n          this.get(\'content\').set(\'graded\', graded);\n          return;\n        }\n\n        var tolerance = numericalResponse.find(\'[type=\"tolerance\"]\').attr(\'default\');\n        if(tolerance){\n          if(tolerance.indexOf(\'%\') >= 0){\n            tolerance = tolerance.replace(\'%\', \'\');\n            tolerance = parseFloat(tolerance);\n            tolerance = tolerance * 0.01;\n          } else {\n            tolerance = parseFloat(tolerance);\n          }\n          var deviation = answer*tolerance;\n          correct = (studentResponse > answer - deviation) && (studentResponse < answer + deviation);\n        } else {\n          correct = studentResponse == answer;\n        }\n        if(correct){\n          score = 1;\n        }\n        graded[args.id] = {\n          correct: correct,\n          feedback: \'\',\n          score: score\n        };\n\n        this.get(\'content\').set(\'graded\', graded);\n      },\n\n      isGradedDidChange: function(){\n        this.$(\'.incorrect\').removeClass(\'incorrect\');\n        var graded = this.get(\'content.graded\');\n        this.get(\'inputs\').forEach(function(i, numericalresponse){\n          var correct = graded[i] && graded[i].correct;\n          if(!correct){\n            // highlight incorrect answer\n            this.$(\'#\' + this.inputPrefix + i).addClass(\'incorrect\');\n          }\n        }.bind(this));\n\n      }.observes(\'content.isGraded\')\n\n    });\n\n\n    // Example xml for Numerical Input\n\n    // <problem display_name=\"Numerical Input\" markdown=\"A numerical input problem accepts a line of text input from the student, and evaluates the input for correctness based on its numerical value.&#10;&#10;The answer is correct if it is within a specified numerical tolerance of the expected answer.&#10;&#10;&gt;&gt;Enter the numerical value of Pi:&lt;&lt;&#10;= 3.14159 +- .02&#10;&#10;&gt;&gt;Enter the approximate value of 502*9:&lt;&lt;&#10;= 4518 +- 15%&#10;&#10;&gt;&gt;Enter the number of fingers on a human hand&lt;&lt;&#10;= 5&#10;&#10;[explanation]&#10;Pi, or the the ratio between a circle\'s circumference to its diameter, is an irrational number known to extreme precision. It is value is approximately equal to 3.14.&#10;&#10;Although you can get an exact value by typing 502*9 into a calculator, the result will be close to 500*10, or 5,000. The grader accepts any response within 15% of the true value, 4518, so that you can use any estimation technique that you like.&#10;&#10;If you look at your hand, you can count that you have five fingers.&#10;[explanation]&#10;\">\n    //   <p>\n    // A numerical input problem accepts a line of text input from the\n    // student, and evaluates the input for correctness based on its\n    // numerical value.\n    // </p>\n    //   <p>\n    // The answer is correct if it is within a specified numerical tolerance\n    // of the expected answer.\n    // </p>\n    //   <script type=\"loncapa/python\">\n    // computed_response = 502*9\n    // </script>\n    //   <p>Enter the numerical value of Pi:\n    //     <numericalresponse answer=\"3.14159\">\n    //       <responseparam type=\"tolerance\" default=\".02\"/>\n    //       <formulaequationinput label=\"Enter the numerical value of Pi\"/>\n    //     </numericalresponse>\n    // </p>\n    //   <p>Enter the approximate value of 502*9:\n    //     <numericalresponse answer=\"$computed_response\"><responseparam type=\"tolerance\" default=\"15%\"/><formulaequationinput label=\"Enter the approximate value of 502 times 9\"/></numericalresponse>\n    // </p>\n    //   <p>Enter the number of fingers on a human hand:\n    //     <numericalresponse answer=\"5\"><formulaequationinput label=\"Enter the number of fingers on a human hand\"/></numericalresponse>\n    // </p>\n    //   <solution>\n    //     <div class=\"detailed-solution\">\n    //       <p>Explanation</p>\n    //       <p>Pi, or the the ratio between a circle\'s circumference to its diameter, is an irrational number known to extreme precision. It is value is approximately equal to 3.14.</p>\n    //       <p>Although you can get an exact value by typing 502*9 into a calculator, the result will be close to 500*10, or 5,000. The grader accepts any response within 15% of the true value, 4518, so that you can use any estimation technique that you like.</p>\n    //       <p>If you look at your hand, you can count that you have five fingers.</p>\n    //     </div>\n    //   </solution>\n    // </problem>\n  });//# sourceURL=oea/components/edx-numeric-input.js");

